import { useState, useEffect } from 'react';
import { TreeTable } from 'primereact/treetable';
import { Column } from 'primereact/column';
import { params } from './params'; // Adjust this import as needed

export default function FullParameterList({ param_type }) {
    const [keyValuePairs, setKeyValuePairs] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        setLoading(true); // Set loading to true each time param_type changes

        if (param_type === 'standard') {
            // Simulate fetching standard parameters and setting them
            setKeyValuePairs([]);
            setLoading(false);
        } else if (param_type === 'advanced') {
            console.log('Fetching advanced params...');
            setKeyValuePairs([]);
            setLoading(false);
        } else if (param_type === 'full') {
            const data = params.getFullParams(); // Assuming you have the full data here
            const transformedData = transformToTree(data);
            setKeyValuePairs(transformedData);
            setLoading(false);
        }
    }, [param_type]);

    const transformToTree = (data) => {
        // Convert your flat data into a hierarchical structure suitable for TreeTable
        return Object.keys(data).map((key) => ({
            key: key,
            value: data[key],
            parent: null,
            children: generateChildren(key, data[key])
        }));
    };

    const generateChildren = (parentKey, parentValue) => {
        if (typeof parentValue === 'object' && !Array.isArray(parentValue)) {
            return Object.keys(parentValue).map((key) => ({
                key: key,
                value: parentValue[key],
                parent: parentKey,
                children: generateChildren(key, parentValue[key])
            }));
        }
        return [];
    };

    return (
        <div className="card">
            {loading ? (
                <p>Loading data...</p> // Add a loading message
            ) : keyValuePairs.length === 0 ? (
                <p>No data available.</p> // Handle empty data case
            ) : (
                <TreeTable value={keyValuePairs} tableStyle={{ minWidth: '50rem' }} paginator rows={10}>
                    <Column field="key" />
                    <Column field="value" header="Value" />
                    <Column field="parent" header="Parent" />
                </TreeTable>
            )}
        </div>
    );
}
